🪷।।আশ্বিনের শারদপ্রাতে বেজে উঠেছে আলোক মঞ্জির,
ধরণীর বহিরাকাশ এ অন্তরিত মেঘমালা,;
প্রকৃতির অন্তরাকাশে জাগরিত জ্যোতির্ময়ী জগৎ মাতার আগমন বার্তা,'
